int wtoi(unsigned short * pshort)
{
    char tmp_buf[12];
	memset(tmp_buf,0,sizeof(tmp_buf));
	if(NULL !=pshort && wstrlen(pshort)>0)
	{
        return atoi(w2a(tmp_buf, pshort));
	}
	return 0;
}

unsigned short  wstrlen(unsigned short * pstr)
{
    unsigned short i=0;
	while(0 != pstr[i])
	{
	    i++;
	}
	return i;
}


void wstrcpy(unsigned short * dest, unsigned short * src)
{
   wstrncpy( dest, src,wstrlen(src));
}

void wstrncpy(unsigned short * dest, unsigned short * src,unsigned short length)
{
    unsigned short i=0;

    for(i=0;i<length;i++)
    {
        dest[i]=src[i];
	}
	dest[length]=0;
}

char * w2a(char * dst, unsigned short * src)
{
    unsigned char i,cnt;
    unsigned char data_len = wstrlen(src);
	i=cnt=0;

	if(NULL == dst )
	{
	    memset(wtc_buf,0,ANSI_GB_BUF_SIZE);
        dst = (char *)wtc_buf;
	}

	for(i=0;i<data_len ;i++)
	{
	     if(src[i]<=get_charset_cmp())
	     {
             dst[cnt++]= src[i]&0x00FF;
	     }
		 else
		 {
             dst[cnt++]= (src[i]&0xFF00)>>8;
			 dst[cnt++]=  src[i]&0x00FF;
		 }
	}
	dst[cnt]=0;

	return dst;
}

unsigned char get_charset_cmp()
{
   if( LANGUAGE_SPANISH == sysprop->byte_language_type   ||  LANGUAGE_PORTUGE== sysprop->byte_language_type  )
   {
       return 0xFF;
   }
   return 0x7F;
}

unsigned short * a2w(unsigned short * dst, char * src)
{
    unsigned char i,cnt;
    unsigned short  data_len = strlen(src);
	unsigned char * pchars =(unsigned char *) src;
	i=cnt=0;

	if(NULL == dst )
	{
	    memset(ctw_buf, 0, ANSI_GB_BUF_SIZE*2);
        dst = ctw_buf;
	}

	for(i=0;i<data_len;i++)
	{
	    if(pchars[i] <= get_charset_cmp())
	    {
             dst[cnt] = pchars[i];
		}
		else
		{
             dst[cnt] = pchars[i]<<8;
			 dst[cnt]+= pchars[i+1];
			 i++;
		}
    	cnt++;
	}
	dst[cnt]=0;
	return dst;
}




unsigned short recursion_uni_fontpos(unsigned short code , unsigned short st, unsigned short et)
{
    if(uni_pos[st] ==  code )
    {
         return st;
	}
	else if(uni_pos[et] ==  code )
	{
         return et;
	}
	else
	{
         unsigned short md= (st+et)/2;

         
		 if( uni_pos[md]  == code)
		 {
              return md;
		 }
		 else
		 {
		     if(md !=st)
		     {
				 if( code >  uni_pos[md] )
				 {
		              return  recursion_uni_fontpos(code , md, et);
				 }
				 else 
				 {
		              return  recursion_uni_fontpos(code , st, md);
				 }
		     }
			 else
			 {
                 return 0xFFFF;
			 }
		 }
	}
}


unsigned char * get_uni_font(unsigned short code)
{
     unsigned short uni_code= recursion_unipos(code-0x8080 , 0, UNI_BASE_LENGTH-1);
     unsigned short pos=recursion_uni_fontpos(uni_code , 0,  UNI_BASE_LENGTH-1);
	
	 if(0xFFFF != pos)
	 { 
		unsigned long font_address = pos;
		font_address*=26;
		return (unsigned char *)(&uni_base[font_address]);
	 }
	 return get_char_font_data('?');
}




